    id: PdfStructElementType
    path: ../dotPDFium/dotPDFium/Native/PdfEnums.cs
    startLine: 826
  assemblies:
  - dotPDFium
  namespace: nebulae.dotPDFium.Native
  summary: Represents the types of structural elements in a PDF document, as defined by the PDF specification.
  remarks: >-
    This enumeration provides a comprehensive list of structural element types that can be used to
        describe the logical structure of a PDF document. These types are commonly used in tagged PDFs to improve
        accessibility, enable content reflow, and provide semantic meaning to document elements.  Each value corresponds to
        a specific structural role, such as headings, lists, tables, or annotations. For example, <xref href="nebulae.dotPDFium.Native.PdfStructElementType.H1" data-throw-if-not-resolved="false"></xref> through
        <xref href="nebulae.dotPDFium.Native.PdfStructElementType.H6" data-throw-if-not-resolved="false"></xref> represent heading levels, while <xref href="nebulae.dotPDFium.Native.PdfStructElementType.Table" data-throw-if-not-resolved="false"></xref>, <xref href="nebulae.dotPDFium.Native.PdfStructElementType.TR" data-throw-if-not-resolved="false"></xref>, <xref href="nebulae.dotPDFium.Native.PdfStructElementType.TH" data-throw-if-not-resolved="false"></xref>, and <xref href="nebulae.dotPDFium.Native.PdfStructElementType.TD" data-throw-if-not-resolved="false"></xref> represent table structures.
  example: []
  syntax:
    content: public enum PdfStructElementType
    content.vb: Public Enum PdfStructElementType
